import React, { Component } from "react";

class DisplayComponent extends Component {

    render() {

        return (

            <div className="App">


                <ul>{
                    this.props.st.map((student) => {
                        return (

                            <li key={student.id}>{student.name}</li>

                        );

                    })
                }
                </ul>

            </div>


        );

    }

}
